 @Julio_Cesar_82  , Bro , mais o Fla do JJ foi um ponto fora da curva , porque houve uma rara simbiose entre torcida treinador e jogadores , “eu p menos nunca vi algo igual aqui no Brasil " , tanto é que aquele jogo contra o Liverpool , foi o jogo mais equilibrado de todos os confrontos entre europeus e sul-americanos , alí realmente deu jogo de altíssimo nível , e indo contrapartida do que eu disse anteriormente , aquele Fla JJ , disputaria títulos no futebol europeu , mais infelizmente aquela equipe foi desfeita com a saída do JJ e também de alguns jogadores de grande importância , no meio lateral e defesa , e mesmo não ganhando o Mundial , foi o melhor jogo de um time sul-americano frente a um europeu , e , discordando de vc , tenho certeza que se o JJ ficasse no Fla , o time iria continuar avassalador por mais alguns anos , porque o que aconteceu com aquela equipe foi algo muito raro no futebol brasileiro , seria algo tipo o Alex Ferguson no futebol inglês.
Mas infelizmente não foi possível manter o JJ , e até hoje eu não sei se foi por grana , ou falta de adaptação de sua família ao Brasil , mais esse Fla do PS tá engrenando e parece que vai dar certo , e vai ser competitivo , porém não dá ser o Fla do JJ , de 2019 porque , aquilo que aconteceu foi algo raríssimo , porém concordo contigo que o BR é o campeonato mais difícil do mundo , não tecnicamente , mas por tudo que vc já mencionou anteriormente.
Boa noite , e fique com Deus.

