 @magrao5021  TOYTA CUP é 👉🚙 , ou seja era um jogo não oficializado intercontinental , portanto  não é MUNDIAL FIFA , que até os próprios europeus só consideravam como intercontinental , e quando a FIFA proibiu os times sul-americanos de chamar de Mundial , os times sul-americanos choraram na FIFA , e aí , é considerado um título com peso de Mundial , más não é MUNDIAL FIFA , igual os títulos do Palmeiras de 51 e Fluminense 52 , que também tem expressão Mundial , mais não é MUNDIAL FIFA , apesar que até o título do Palmeiras foi organizado pela FIFA e a taça foi entregue pelo PRÓPRIO presidente da FIFA Giles Rimet , já as toytas nem foi realizada pela FIFA.
Em tese a pinga 51 das pepas 🐷 é mais mundial que o jipe 🚙 de vcs.
Únicos Campeões MUNDIAIS FIFA SÃO : Corinthians , Inter e Trikas SP kkkkkkkkkkkkkkkk 😁

