 @marcosantoniochaves7279  Cara eu não disse que o Palmeiras ficou na retranca, apenas dei a entender que o Palmeiras optou muito mais pela marcação e você está esquecendo que o Abel Ferreira já está a praticamente 2 anos no Palmeiras enquanto que o Paulo Sousa chegou a pouco tempo e mesmo assim o Flamengo teve mais volume. O Palmeiras está a três jogos sem vencer no campeonato justamente por quê tem mais dificuldade em pontos corridos é muito mais um time copeiro e isso é nítido, mas o atual Bi campeão da América deveria se impor mais, é a minha opinião. 
Lembrando que o Palmeiras ainda não conseguiu vencer o Flamengo no campeonato brasileiro e também não venceu o Atlético-MG, ou seja os dois principais adversários o Palmeiras não consegue vencer e sempre que enfrenta essas duas equipes o Abel Ferreira opta pela marcação mais recuada e isso acaba com o potencial do elenco pq ele obriga o Veiga a virar um volante de marcação e o Dudu fica exausto de tanto correr pra puxar os contra ataques. 
O elenco do Palmeiras tem condições de jogar melhor (contra Fla e Galo), resta saber se o Abel Ferreira irá perder o preciosismo.

